import React from "react";

const Installment = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <h1>Installment</h1>
    </div>
  );
};

export default Installment;
